import React from "react";
import "./Logo.scss";

const Logo = () => {
  return (
    <div className="logo">
      <a href="#home">
        <img
          width="50px"
          src="https://image.ibb.co/fujxD0/mylogo2.png"
          alt="JM"
        />
      </a>
    </div>
  );
};

export default Logo;
